const Put = props => {
    const { jono, seuraava } = props;
    axios.put('http://192.168.220.139:9595/components/api/server/id/1', {
        "id" : '1',
        "hostname" : 'jokuhosti',
        "enabled" : '1',
        "created" : 'data',
        "jono" : {jono},
        "seuraava" : {seuraava},
    })
    return (
        <div>1</div>
    );
  };

export default Put
